//測試個人

import React,{Component} from "react";
import {LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend} from"recharts";
import {Div0,DataDrawItem,Div1} from'./sty';

const token ='eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJ1c2VyX2lkIjoiYWRtaW4iLCJfaWQiOiI2MzRhNDg5OTJkNzAyY2EzYWRlNTlmMzYiLCJlbWFpbCI6InpzZGE1ODU4c2RhQGdtYWlsLmNvbSIsInJvbGUiOjkwMCwiZXhwIjoxNjY1OTA1MjcxfQ.e3xoaWLyhowVnA5MQ3ToFSP36H9XmyJSO04x-G6NsLU';
const data = [
    {name: 'Page A', deltoid: 4000, biceps: 2400, squat: 2400},
    {name: 'Page B', deltoid: 3000, biceps: 1398, squat: 2210},
    {name: 'Page C', deltoid: 2000, biceps: 9800, squat: 2290},
    {name: 'Page D', deltoid: 2780, biceps: 3908, squat: 2000},
    {name: 'Page E', deltoid: 1890, biceps: 4800, squat: 2181},
    {name: 'Page F', deltoid: 2390, biceps: 3800, squat: 2500},
    {name: 'Page G', deltoid: 3490, biceps: 4300, squat: 2100},
];
// const dataq =()=>{
//     return fetch(`https://backend-111406.onrender.com/api/record/admin`, {
//         method: "GET",
//         headers: new Headers({
//             'Content-Type': 'application/json',
//             'Authorization': `Bearer ${token}`, /* 把token放在這 */
//         })
//       })
//       .then(res => res.json())
//       .then(data => {
//         this.setState({repoName: data[0]['name']});
//             /*接到request data後要做的事情*/
//       })
//       .catch(e => {
//           /*發生錯誤時要做的事情*/
//       })
//     };
class DataDrawList extends Component{
    constructor(props){
        super(props);
        this.state={
        "data":[]
    };
    }
    componentDidMount(){
    this.getItems();
    }
    getItems(){
    fetch('https://backend-111406.onrender.com/api/record/admin', {
                method: "GET",
                headers: new Headers({
                    'Content-Type': 'application/json',
                    'Authorization': `Bearer ${token}`, /* 把token放在這 */
                })
}
    )
    .then(results=>results.json())
    .then(results=>this.setState({"data":results.data}));
    }
    render(){
        return (
                <Div0>
                    <DataDrawItem>
                    {/* <Div1>最近五次</Div1> */}
                    <LineChart width={400} height={250} data={data}
                    margin={{top: 5, right: 30, left: 20, bottom: 5}}>
                <XAxis dataKey="name"/>
                <YAxis/>
                <CartesianGrid strokeDasharray="3 3"/>
                <Tooltip/>
                <Legend />
                <Line type="monotone" dataKey="biceps" stroke="#8884d8" activeDot={{r: 8}}/>
                <Line type="monotone" dataKey="deltoid" stroke="#82ca9d" />
                <Line type="monotone" dataKey="squat" stroke="#7C9C99" />
            </LineChart>
                    </DataDrawItem>
                    <DataDrawItem>
                    <LineChart width={400} height={250} data={data}
                    margin={{top: 5, right: 30, left: 20, bottom: 5}}>
                <XAxis dataKey="name"/>
                <YAxis/>
                <CartesianGrid strokeDasharray="3 3"/>
                <Tooltip/>
                <Legend />
                <Line type="monotone" dataKey="biceps" stroke="#8884d8" activeDot={{r: 8}}/>
                <Line type="monotone" dataKey="deltoid" stroke="#82ca9d" />
                <Line type="monotone" dataKey="squat" stroke="#7C9C99" />
            </LineChart>
                    </DataDrawItem>
                    <DataDrawItem></DataDrawItem>
                </Div0>
        )}}
export default DataDrawList;
